const add = (a, b) => {
    console.log(a + b)
    return a + b
}

const sub = (a, b) => {
    return a - b
}

const mul = (a, b) => {
    return a * b
}
const Div = (a, b) => {
    let div = a / b
    return div
}

const name = 'vaibhav '

export { add, sub, name, mul, Div };
